import React from "react";
import { MDBBtn, MDBInput,MDBInputGroup } from 'mdb-react-ui-kit';
const style = {
    width: "80%",
    marginTop:"20px",
    marginLeft:"9%",
}

 const TodoForm = () => {
        return ( 

        <form className="todo-form" style={style}>
            <MDBInputGroup>
             <MDBInput className="todo-list" label='Example label' id='form1'  />
            </MDBInputGroup>
           
             <MDBBtn color='primary'>Add</MDBBtn>
        </form>
        );
    };
    export default TodoForm;
